import React, { useState, useEffect } from 'react';
import styled from 'styled-components';
import Header from './components/Header';
import ImageUploader from './components/ImageUploader';
import ImageDownloader from './components/ImageDownloader';
import AnalysisResults from './components/AnalysisResults';
import PathVisualization from './components/PathVisualization';
import Dashboard from './components/Dashboard';
import { analyzeImage, planPath, getHealthStatus } from './services/api';

const AppContainer = styled.div`
  min-height: 100vh;
  background: linear-gradient(135deg, #0c0c0c 0%, #1a1a2e 50%, #16213e 100%);
  color: #ffffff;
`;

const MainContent = styled.div`
  max-width: 1400px;
  margin: 0 auto;
  padding: 20px;
  display: grid;
  grid-template-columns: 1fr 1fr;
  gap: 30px;
  min-height: calc(100vh - 80px);

  @media (max-width: 1024px) {
    grid-template-columns: 1fr;
    gap: 20px;
    padding: 15px;
  }
`;

const LeftPanel = styled.div`
  display: flex;
  flex-direction: column;
  gap: 20px;
`;

const RightPanel = styled.div`
  display: flex;
  flex-direction: column;
  gap: 20px;
`;

const StatusIndicator = styled.div`
  position: fixed;
  top: 100px;
  right: 20px;
  padding: 10px 15px;
  background: ${props => props.status === 'connected' ? 'rgba(0, 255, 0, 0.2)' : 'rgba(255, 0, 0, 0.2)'};
  border: 1px solid ${props => props.status === 'connected' ? '#00ff00' : '#ff0000'};
  border-radius: 8px;
  font-size: 12px;
  z-index: 1000;
  backdrop-filter: blur(10px);
`;

function App() {
  const [analysisResult, setAnalysisResult] = useState(null);
  const [pathResult, setPathResult] = useState(null);
  const [isAnalyzing, setIsAnalyzing] = useState(false);
  const [isPlanningPath, setIsPlanningPath] = useState(false);
  const [serverStatus, setServerStatus] = useState('checking');
  const [selectedImage, setSelectedImage] = useState(null);
  const [showDownloader, setShowDownloader] = useState(false);

  // Check server health on component mount
  useEffect(() => {
    checkServerHealth();
    const interval = setInterval(checkServerHealth, 30000); // Check every 30 seconds
    return () => clearInterval(interval);
  }, []);

  const checkServerHealth = async () => {
    try {
      const response = await getHealthStatus();
      setServerStatus('connected');
    } catch (error) {
      setServerStatus('disconnected');
    }
  };

  const handleImageAnalysis = async (imageFile) => {
    setIsAnalyzing(true);
    setSelectedImage(imageFile);

    try {
      const result = await analyzeImage(imageFile);
      setAnalysisResult(result);

      // If feasible debris found, automatically plan path
      if (result.feasible_objects > 0) {
        handlePathPlanning(result.feasible_debris);
      }
    } catch (error) {
      console.error('Analysis failed:', error);
    } finally {
      setIsAnalyzing(false);
    }
  };

  const handlePathPlanning = async (debrisList = null) => {
    setIsPlanningPath(true);

    try {
      const debris = debrisList || analysisResult?.feasible_debris || [];
      const result = await planPath(debris);
      setPathResult(result);
    } catch (error) {
      console.error('Path planning failed:', error);
    } finally {
      setIsPlanningPath(false);
    }
  };

  const resetAnalysis = () => {
    setAnalysisResult(null);
    setPathResult(null);
    setSelectedImage(null);
  };

  const handleDownloadedImageSelect = (imagePath) => {
    // Convert the downloaded image path to a file object for analysis
    fetch(`http://localhost:5000/${imagePath}`)
      .then(response => response.blob())
      .then(blob => {
        const file = new File([blob], imagePath.split('/').pop(), { type: blob.type });
        handleImageAnalysis(file);
        setShowDownloader(false);
      })
      .catch(error => {
        console.error('Error loading downloaded image:', error);
      });
  };

  return (
    <AppContainer>
      <Header />

      <StatusIndicator status={serverStatus}>
        {serverStatus === 'connected' ? 'ðŸŸ¢ Server Connected' : 'ðŸ”´ Server Disconnected'}
      </StatusIndicator>

      <MainContent>
        <LeftPanel>
          {!showDownloader ? (
            <>
              <ImageUploader 
                onImageUpload={handleImageAnalysis}
                isAnalyzing={isAnalyzing}
                onReset={resetAnalysis}
              />

              {analysisResult && (
                <AnalysisResults 
                  result={analysisResult}
                  selectedImage={selectedImage}
                  onPlanPath={() => handlePathPlanning()}
                  isPlanningPath={isPlanningPath}
                />
              )}
            </>
          ) : (
            <ImageDownloader 
              onImageSelect={handleDownloadedImageSelect}
            />
          )}
        </LeftPanel>

        <RightPanel>
          <Dashboard 
            analysisResult={analysisResult}
            pathResult={pathResult}
            serverStatus={serverStatus}
          />

          {pathResult && (
            <PathVisualization 
              pathData={pathResult}
              analysisResult={analysisResult}
            />
          )}

          {!showDownloader && (
            <div style={{ marginTop: '20px' }}>
              <button
                onClick={() => setShowDownloader(true)}
                style={{
                  background: 'rgba(0, 255, 255, 0.2)',
                  border: '1px solid #00ffff',
                  padding: '10px 20px',
                  borderRadius: '20px',
                  color: '#ffffff',
                  fontSize: '12px',
                  cursor: 'pointer',
                  width: '100%',
                  transition: 'all 0.3s ease'
                }}
                onMouseOver={(e) => {
                  e.target.style.background = 'rgba(0, 255, 255, 0.3)';
                }}
                onMouseOut={(e) => {
                  e.target.style.background = 'rgba(0, 255, 255, 0.2)';
                }}
              >
                ðŸ“¥ Download Space Images
              </button>
            </div>
          )}

          {showDownloader && (
            <div style={{ marginTop: '20px' }}>
              <button
                onClick={() => setShowDownloader(false)}
                style={{
                  background: 'rgba(255, 255, 255, 0.1)',
                  border: '1px solid rgba(255, 255, 255, 0.3)',
                  padding: '10px 20px',
                  borderRadius: '20px',
                  color: '#ffffff',
                  fontSize: '12px',
                  cursor: 'pointer',
                  width: '100%',
                  transition: 'all 0.3s ease'
                }}
                onMouseOver={(e) => {
                  e.target.style.background = 'rgba(255, 255, 255, 0.2)';
                }}
                onMouseOut={(e) => {
                  e.target.style.background = 'rgba(255, 255, 255, 0.1)';
                }}
              >
                ðŸ“¤ Back to Upload
              </button>
            </div>
          )}
        </RightPanel>
      </MainContent>
    </AppContainer>
  );
}

export default App;
